create table users
(
    id         bigserial
        primary key,
    created_at timestamp(6),
    created_by varchar(255),
    updated_at timestamp(6),
    updated_by varchar(255),
    uuid       varchar(255)
        constraint uk_6km2m9i3vjuy36rnvkgj1l61s
            unique,
    email      varchar(255),
    first_name varchar(255),
    last_name  varchar(255),
    password   varchar(255),
    phone      varchar(255)
);



create table addresses
(
    id         bigserial
        primary key,
    created_at timestamp(6),
    created_by varchar(255),
    updated_at timestamp(6),
    updated_by varchar(255),
    uuid       varchar(255)
        constraint uk_jrhri6bt0pf6tjfingm6q69sq
            unique,
    city       varchar(255),
    country    varchar(255),
    latitude   double precision,
    longitude  double precision,
    state      varchar(255),
    street     varchar(255),
    zip_code   varchar(255),
    user_id    bigint
        constraint fk1fa36y2oqhao3wgg2rw1pi459
            references users
);


